import React from "react";
import './style.css';

function Navbar() {
  return (
    <>
    <nav className="navbar">
    <div className='navbar-container'>
      <link to="/" className="navbar-logo">


      </link>
    </div>
    </nav>
  
    </>
  )
}

export default Navbar
